import react from "react";
import NoteContext from "./noteContext";

const NoteState = ()=> {
    const state = {
        "name" : "Minaz",
        "class" : "17th"
    }
    return (
        <NoteState.provider value={state}>
            {props.children}
        </NoteState.provider>
    )
}

export default NoteState;
